// flow of data from parent to child
class Parent extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      person1: "John Doe",
      person2: "Jane Doe"
    }
  }

  render() {
    return (
      <div>
        <Child toChild={this.state.person1} />
        <Child toChild={this.state.person2} />
      </div>
    )
  }

}


class Child extends React.Component {

  render() {
    return (
      <h2>Name: {this.props.toChild} </h2>
    )
  }

}

