const arr = [ "zero", "one", "two", "three" ];

// ES5
arr.map(function(val, i) {
  return (val + " is at index " + i);
}); 
/* outputs: 
  [
    "zero is at index 0", 
    "one is at index 1", 
    "two is at index 2",
    "three is at index 3"
  ]
*/

// ES6
arr.map((val,i) => (`${val} is at index ${i}`))
/* outputs: 
  [
    "zero is at index 0", 
    "one is at index 1", 
    "two is at index 2",
    "three is at index 3"
  ]
*/

// ES5 callback
function mapperES5(a, b) {
  return (a + " is at index " + b);
}

// invoking ES5 cb
arr.map(mapperES5)

// ES6 callback
const mapperES6 = (a,b) => (a + " is at index " + b);
// in the above note, that right after the "fat-arrow"
// we are using parenthesis which implicitly creates
// a `return` statement, and no need to insert `return`

// invoking ES6 cb
arr.map(mapperES6)

// both of the above produce the same exact result
// this could also be personal preference, but according
// to style guides as well as GPP, the latter is
// better for readability purposes
